import React from "react";
import './Emailv.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const Emailv = () =>{
    return(
        <>
        <div className="container ">
            
            <div className="row justify-content-center">
                <div className="col-5 box">
                        <h1>Get Started</h1>
                        <p>Please enter your details</p>
                        <input className="form-control email-form" type="email" placeholder=";" />
                        <button class="btn btn-secondary form-control button-cs" type="button">Sign up</button>
                </div>

            </div>
        </div>
        
        </>
    )
}

export default Emailv;
